import React, { useState } from "react";

const SignUp = () => {
  const [data, setData] = useState({
    name: "",
    email: "",
    password: "",
    confirmPassword: "",
    isAccepted: false,
  });

  const chaneHandler = (event) => {
    console.log(event.target);
  };
  return (
    <div>
      <form>
        <h2>SignUp</h2>
        <div>
          <label>Name</label>
          <input type="text" name="name" value={data.name} onChange={chaneHandler} />
        </div>
        <div>
          <label>Email</label>
          <input type="text" name="email" value={data.email} onChange={chaneHandler} />
        </div>
        <div>
          <label>Password</label>
          <input type="password" name="password" value={data.password} onChange={chaneHandler} />
        </div>
        <div>
          <label>Confirm Password</label>
          <input type="password" name="confirmPassword"
            value={data.confirmPassword} onChange={chaneHandler}
          />
        </div>
        <div>
          <label>I accept terms of privacy policy</label>
          <input type="checkbox" name="isAccepted" value={data.isAccepted} onChange={chaneHandler} />
        </div>
        <div>
          <a href="www.google.com">Login</a>
          <button type="submit">SignUp</button>
        </div>
      </form>
    </div>
  );
};

export default SignUp;
